import React from "react";
import "./Searchbar.css"


export default function Searchbar() {
  return (
    <form class="form-inline my-2 my-lg-0">
      <input
        class="form-control mr-large-2"
        type="search"
        placeholder="Search"
        aria-label="Search"
      />
    </form>
  );
}
